// src/components/Contact.js
import React from 'react';
import './style1.css'; // Import your styles if needed

const Contact = () => {
  return (
    <div>
      <section className="header">
        <img src="./images/indexbanner.jpg" className="back-video" alt="Header Background" />
        <nav>
          {/* ... (your navigation code) ... */}
        </nav>
        <div className="contact-me hidden">
          <h9>Contact Me</h9>
        </div>
      </section>

      <div className="row">
        {/* Add your contact form and information */}
      </div>
    </div>
  );
};

export default Contact;
